import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import './App.css';
import Home from './Pages/Home';
import BlogPage from './Pages/BlogPage';
import Login from './Pages/Login';
import Register from './Pages/Register';
import UserDashborad from './Pages/UserDashborad';
import BasicLoading from './Pages/BasicLoadin';

const currUser = localStorage.getItem("user")
const protectedRoute = (element) => currUser ? element : <Login />;

const router = createBrowserRouter([
  {
    path:"/",
    element : <Home />
  },
  {
    path:"/blog",
    element : <BlogPage />
  },
  {
    path: "/login",
    element: currUser ? <UserDashborad /> : <Login />
  },
  {
    path: "/register",
    element: <Register />    
  },
  {
    path: "/dashboard",
    element: protectedRoute(<UserDashborad />)    
  },
  {
    path: "/loginLoading",
    element: protectedRoute(<BasicLoading />)
  },

])


function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
